import axios from 'axios';
import React, { useEffect, useState, useRef } from 'react';


const History: React.FC = () => {
  const episode_number = useRef<number>(0);
  useEffect(()=>{
    axios.get(`/episode_number`)
      .then((res) => {
        episode_number.current = res.data.episode_number;
      });
  },[]);
  const videoList = [...Array(10)].map((x, i) =>
    <div className="flex flex-row my-4">
      <div className="flex flex-col">
        <div className="flex flex-row mx-auto">
          Episode {i}
        </div>
        <div className="flex flex-row">
          <video className="rounded-xl mx-4" autoPlay loop muted width="140" height="140" src={`videos/video_one_${i+1}.mp4`}/>
          <video className="rounded-xl mx-4" autoPlay loop muted width="140" height="140" src={`videos/video_two_${i+1}.mp4`}/>
        </div>
      </div>
    </div>
  );

  return (
    <div className="flex flex-col overflow-auto justify-items-center align-center mx-auto">
      {videoList}
    </div>
  );
};

export default History;
